def get_user_ids(curs, start_date, end_date, start_id):
    curs.execute(
        "SELECT maker_id FROM playlist_info GROUP BY maker_id HAVING max(last_update) BETWEEN '"
        + start_date + "' AND '" + end_date + "' AND maker_id >= " + start_id + " ORDER BY maker_id")

    return [str(user[0]) for user in curs.fetchall()]


